const Benefits = () => {
    return (
        <section className="benefits">
            <div>
                <h4>KOME FITY POMAŽE</h4>
                <h2>Ukoliko se dugo mučiš sa restriktivnim dijetama, odricanjem od hrane ili nemaš vremena, volje i
                    znanja da samostalno sastaviš i pratiš plan ishrane koji će te odvesti do cilja, Fity je pravo
                    rešenje za tebe.</h2>
                <div className="flex gap-20">

                </div>
            </div>
        </section>
    );
};

export default Benefits;
